// Favorites.jsx
import React from 'react';

const Favorites = ({ favoritesList }) => {
  return (
      <div className="favorites">
          {favoritesList.map(favorite => (
              <a key={favorite.id} href={`/favorite/${favorite.id}`} className="favorite-link">
                  {favorite.title}
              </a>
          ))}
      </div>
  );
};


export default Favorites;
